import React, { useEffect } from 'react'
import { Row, Col } from 'antd';
import 'antd/dist/antd.css';
import './DetailPokemon.css'
import { callApidata } from '../../api/callAPI';
import { pokemon,listfilm ,pokemon1} from './DPstore';
function Detail(){
    console.log(pokemon)
    pokemonin=pokemon
    useEffect(()=>{
        callApidata('102','pokemon').then(res=>{
            // pokemon=res.data
            // let red=res.data.sprites.versions.red-blue;
            // console.log(res.data.sprites.versions.generation-i)
            console.log(res.data)
            let ab=res.data.abilities;
            let back_default=res.data.sprites.back_default
            let back_shiny=res.data.sprites.back_shiny
            let id=res.data.id
            let name=res.data.name
            pokemonin=pokemon1.create({id:id,abilities:res.data.abilities,back_default:back_default,back_shiny:back_shiny,name:name})
            // let sp=
        })
    },[])
    // console.log(pokemon)
    return(
        <Row gutter={[16, 16]} className="detail">
            <Col span={6} ></Col>
            <Col span={12}>
                <Row>
                    <Col span={12}> 
                        <img src='https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/back/102.png'></img>
                    </Col>
                    <Col span={12}> </Col>
                </Row>
            </Col>
            <Col span={6} ></Col>
        </Row>
    )
}
export default Detail
